import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './Login'

const Naviga = () => {
  return (
    <div>
      <Router>
        <Switch>
            <Route exact path='/' element={<Login/>}/>
        </Switch>
      </Router>
    </div>
  )
}

export default Routes
